D'Addario EZ900 85/15 Bronze Akustik Gitar Tel Seti, Ekstra Light (010-050)
&nbsp;
&nbsp;
Tam takım akustik gitar teli.
Kalınlık: Extra light gauge (.010-.050).
Sarımlı teller yuvarlak sarım olup 85/15 bronz alaşımındandır. Sarımsız teller düz çeliktir.
85/15 Bronz alaşımı 80/20 bronz alaşımının ses parlaklığını Fosfor Bronz Alaşım tellerin uzun ömürlü olma karakteristiği ile birleştirmiştir.
85/15 Alaşım bronz sarım teli çok hassas bir şekilde, altıgen kesite sahip yüksek karbonlu özel çekim çelik çekirdek telin üzerine uzun dayanma süresi sağlayacak, parlak bir ses tonu verecek ve mükemmel bir intonasyon oluşturacak şekilde sarılmıştır. EZ900 telleri reguler tellere göre daha kolay çalınabilme özelliğine sahip olmakla birlikte dengeli ve akustik bir ton yansıtır.
Teller her dem tazeliğinin korunması için korozyondan korumalı şekilde paketlenmiştir.
D'Addario, New York ABD tesislerinde üretilmiştir.
